    [],nt"revision_timestamp": "2016-07-27T22:44:48.618310",nt"name": "montana-fish-wildlife-parks-2008-avian-influenza-surveillance-project-report",nt"isopen":
    false,nt"url": null,nt"notes": "This report covers the work performed by
    Montana Fish, Wildlife and Parks (FWP) during the 2008 surveillance period. The
    objectives of the project were to employ multiple sampling strategies to maximize
    the chance of detecting HP-H5N1, including sampling live and hunter-harvested waterfowl
    throughout fall migration and collecting samples from wild bird mortality/morbidity
    events. To achieve the 2008 objectives, personnel from FWP collected 860 swab samples
    from live and hunter-harvested birds and 42 mortality/morbidity samples. Six weekly
    prospective mortality transects (n=128) were also conducted on lakes and wetlands
    throughout the state to systematically record the presence of target bird populations
    and mortality events. Avian influenza virus in low pathogenic form was detected
    in Montana samples as expected, while HP-H5N1 was not found during the three years
    of surveillance in Montana or elsewhere in North America.",nt"license_title":
